import Header from "../components/Header";
import "../style.css";

function Index() {
    return (
        <main className="main">
            <Header />
            <section className="content">
                <h1>Hi, my name is Orion.</h1>
                <p>Here's some stuff about me.</p>
            </section>
        </main>
    );
}

export default Index;
